import React from 'react';
import {SafeAreaView, View, FlatList, StyleSheet, Text, StatusBar,ImageBackground } from 'react-native';
import { DATA } from '../../utils/data';
import Cabecalho from './components/Cabecalho';
import {useFonts} from 'expo-font';
import { TouchableOpacity } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';


const ListaMisterios = () =>{

  const [loaded] = useFonts({
    MontserratSemiBold: require('../../../assets/fonts/Montserrat-SemiBold.ttf'),
  });
  if (!loaded) {
    return null;
  }


  const navigation = useNavigation();
  
  return (
    <SafeAreaView style={{flex: 1}}>

      <Cabecalho/>

        <View style={{flex: 1, flexDirection: 'column', justifyContent: 'flex-start', marginHorizontal: 20}}>
          <TouchableOpacity onPress={() => navigation.replace('ContemplacaoMisterios')}>
            <ImageBackground source={require('../../../assets/misterios/gozosos.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={styles.buttons}>
              <Text style={styles.textButtons}>Mistério Gozoso</Text>
            </ImageBackground>
          </TouchableOpacity>

          <TouchableOpacity>
            <ImageBackground source={require('../../../assets/misterios/luminosos.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={styles.buttons}>
              <Text style={styles.textButtons}>Mistério Luminoso</Text>
            </ImageBackground>
          </TouchableOpacity>

          <TouchableOpacity>
            <ImageBackground source={require('../../../assets/misterios/doloroso.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={styles.buttons}>
              <Text style={styles.textButtons}>Mistério Doloroso</Text>
            </ImageBackground>
          </TouchableOpacity>

          <TouchableOpacity>
            <ImageBackground source={require('../../../assets/misterios/gloriosos.jpg')} imageStyle={{ borderRadius: 5, height: 95}} style={styles.buttons}>
              <Text style={styles.textButtons}>Mistério Glorioso</Text>
            </ImageBackground>
          </TouchableOpacity>
        </View>
      
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
 textButtons:{
  fontFamily: 'MontserratSemiBold',
  fontSize: 22,
  color:'white', 
  textAlign: 'center',
  position: 'relative', 
  top: 35 
 },
 buttons:{
   marginBottom: 100
 }
});
export default ListaMisterios;
